def prepare_keystream(key: int) -> list[int]:

    def _invert_lsb_and_append_as_msb_u16(number: int) -> int:
        return ((number >> 1) | (~(number & 1) << 15)) & U16_MAX_VALUE

    NUMBERS_PER_ROUND = 3
    keystream = [0] * 48
    key1 = key ^ 0x0633a998
    key2 = key ^ 0x4e6c32b9

    # we need to split the resulting 4-byte big-endian numbers into pairs of 2 bytes in little-endian
    # for example, from 0x4a2d1745 and 0x02728c64, we should get v38 = 0x2d4a, v39 = 0x4517, v40 = 0x7202, v41 = 0x648c
    keys = struct.pack('>ii', key1, key2)
    k1, k2, k3, k4 = struct.unpack('<HHHH', keys)

    # keystream is a set of 48 numbers; each "round" generates three numbers
    for round_num in range(16):
        base_offset = NUMBERS_PER_ROUND * round_num
        # these rotations were calculated on the fly in a cool way, but i'm a bit lazy
        if round_num in [1, 2, 3, 7, 8]:
            k1, k2, k3, k4 = k2, k3, k4, k1
        elif round_num in [4, 5, 10, 12, 14]:
            k1, k2, k3, k4 = k4, k1, k2, k3
        elif round_num in [6, 9, 11, 13, 15]:
            k1, k2, k3, k4 = k3, k4, k1, k2

        for i in range(15):
            index = base_offset + (i % 3)
            k1_lsb = k1 & 1
            k2_lsb = k2 & 1
            k3_lsb = k3 & 1
            k4_lsb = k4 & 1
            keystream[index] = ((keystream[index] << 4) | k1_lsb << 3 | k2_lsb << 2 | k3_lsb << 1 | k4_lsb) & 0x7FFFFFFFF
            k1 = _invert_lsb_and_append_as_msb_u16(k1)
            k2 = _invert_lsb_and_append_as_msb_u16(k2)
            k3 = _invert_lsb_and_append_as_msb_u16(k3)
            k4 = _invert_lsb_and_append_as_msb_u16(k4)

    return keystream


def _generate_xor_key(block: int, keystream: list[int]) -> int:
    assert (len(keystream) == 3)
    LSB_10_BITS = 0b00000000001111111111

    # selects bits 0-1, 24-31, 16-25, 20 bits total
    scramble1 = (((block & 0b11) << 18) | ((block >> 24) << 10) | ((block >> 16) & LSB_10_BITS)) & U32_MAX_VALUE
    # selects bits 8-17, 0-9, 20 bits total
    scramble2 = ((block & (LSB_10_BITS << 8)) << 2) | block & LSB_10_BITS

    # scramble1: MSB -> [01, 00, 31, 30, 29, 28, 27, 26, 25, 24, 25, 24, 23, 22, 21, 20, 19, 18, 17, 16] <- LSB
    # scramble2: MSB -> [17, 16, 15, 14, 13, 12, 11, 10, 09, 08, 09, 08, 07, 06, 05, 04, 03, 02, 01, 00] <- LSB

    scrambled_key = (keystream[2] & (scramble1 ^ scramble2)) & U32_MAX_VALUE

    # temp1 and temp2 are 20-bit, keystream is 20-bit as well
    temp1 = (scrambled_key ^ scramble2 ^ keystream[1])
    temp2 = (scrambled_key ^ scramble1 ^ keystream[0])

    scrambled_key = (
            DECRYPT_TABLE[(temp1 & LSB_10_BITS) | 0xC00] |
            DECRYPT_TABLE[(temp2 & LSB_10_BITS) | 0x400] |
            DECRYPT_TABLE[(temp1 >> 10) | 0x800] |
            DECRYPT_TABLE[temp2 >> 10]
    )

    return scrambled_key


def perform_decrypt(data: bytes, keystream: list[int]) -> bytes:
    assert (len(data) == 8)
    assert (len(keystream) == 48)

    KS_ROUND_LEN = 6
    KS_ROUND_MID_IND = int(KS_ROUND_LEN / 2)

    block1 = int.from_bytes(bytes=data[0:4], byteorder='big')
    block2 = int.from_bytes(bytes=data[4:8], byteorder='big')

    keystream_index = 48
    for _ in range(8):
        round_keystream = keystream[(keystream_index - KS_ROUND_LEN):keystream_index]
        keystream_index -= KS_ROUND_LEN

        block1_key = _generate_xor_key(block=block2, keystream=round_keystream[KS_ROUND_MID_IND:KS_ROUND_LEN])
        block1 ^= block1_key

        block2_key = _generate_xor_key(block=block1, keystream=round_keystream[0:KS_ROUND_MID_IND])
        block2 ^= block2_key

    b2_0, b2_1, b2_2, b2_3 = struct.unpack('<BBBB', struct.pack('>I', block2))
    b1_0, b1_1, b1_2, b1_3 = struct.unpack('<BBBB', struct.pack('>I', block1))

    return bytes([b2_0, b2_1, b2_2, b2_3, b1_0, b1_1, b1_2, b1_3])


def decrypt(private_metadata: bytes, key: int) -> bytes:
    keystream = prepare_keystream(key=key)
    decrypted = bytes()

    for block_num in range(len(private_metadata) // 8):
        block = private_metadata[block_num * 8:(block_num + 1) * 8]
        block = perform_decrypt(data=block, keystream=keystream)
        decrypted += block

    return decrypted
